import { Grid } from "@material-ui/core";
import CoffeCard from "./CoffeCard";
import coffeMakerList from './constants';

const Content = () => {
  return (
    <Grid container spacing={2}>
      {
        coffeMakerList.map(item => {
         <Grid item xs={12} sm={4}>
        <CoffeCard 
          title={item.title}
          subtitle="89.99"
          avatarUrl="https://upload.wikimedia.org/wikipedia/commons/e/e0/Keurig_Logo.png" 
          imgUrl="https://images-na.ssl-images-amazon.com/images/I/61-KUPluVYL._AC_SL1500_.jpg"
          description="Use both ground coffee and k-cup pods. Multiple brew sizes: brew an 8, 10, or 12-cup carafe and an 237, 296, or 355ml (8, 10, or 12 oz. ) cup "
        />
      </Grid>
        })
      }
      <Grid item xs={12} sm={4}>
        <CoffeCard 
          title="Hamilton Beach Flexbrew"
          subtitle="89.99"
          avatarUrl="https://upload.wikimedia.org/wikipedia/commons/e/e0/Keurig_Logo.png" 
          imgUrl="https://images-na.ssl-images-amazon.com/images/I/61-KUPluVYL._AC_SL1500_.jpg"
          description="Use both ground coffee and k-cup pods. Multiple brew sizes: brew an 8, 10, or 12-cup carafe and an 237, 296, or 355ml (8, 10, or 12 oz. ) cup "
        />
      </Grid>
    </Grid>
  )
}

export default Content;
